function getALMA(window, sigma, offset, arr) {
    let m = (offset * (window - 1))
    let s = window / sigma

    let weightedSum = 0
    let cumWt = 0

    for (i = 0; i < window - 1; i++) {
        let wtd = Math.exp(-((i - m) * (i - m)) / (2 * s * s))
